import axios from 'axios';

const BASE_URL = '/api/v1/user';

// Fetch the user's profile
export const getUserProfile = () => axios.get(`${BASE_URL}/{userId}`);

// Update the user's profile
export const updateUserProfile = (data) => axios.put(`${BASE_URL}/{userId}`, data);
